(function($) {
  // Initialize function on window load and resize.
  $(document).ready(function() {
    $("#footer").place_footer();
  });
  $(window).load(function() {     
    $("#footer").place_footer();
  });
  $(window).resize(function() {
    $("#footer").place_footer();
  });
}(jQuery));

(function($) {
"use strict";
  $.fn.place_footer = function() {
    // Unset footer's margin which possibly has been set on previous events
    // and is not valid any more.
    try{
      this.css({"margin-top": "0px"});
  
      var pos = this.position();
      var height = $(window).height();
      var menu_height = $('#admin-menu').height();
  
      height = height - menu_height - pos.top;
      height = height - this.outerHeight();
      if (height > 0) {
        this.css({
          "margin-top": height + "px"
        });
      }
      return this;
    }catch(e){}
  }
}(jQuery));
